import React from "react";

import style from "./Header.module.css";

function Header() {
  return (
    <div>
      <div className={style.header}>
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/b/b6/Flag_of_Canada.png"
          alt="Canada Flag"
          className={style.canadaFlag}
        />
        <img
          src="https://i.redd.it/lx9mg85bdph11.png"
          alt="Canada Flag"
          className={style.canadaFlag}
        />
        <h1 className={style.title}> Nous allons aller au Quebec </h1>
      </div>
    </div>
  );
}

export default Header;
